class ActorComponent {
    constructor(dbService) {
        this.dbService = dbService;
        this.actorsDB = [];
        this.section = 1;
        this.fullName = "";
        this.bYear = 0;
        this.actorId = "";
        // to show the list of movies available
        this.moviesDB = [];
        this.updatedMovie = null;
        //selected movie and actor for section 5
        this.selectedActor = null;
        this.selectedMovie = null;
    }
    //Get all Actors
    onGetActors() {
        this.dbService.getActors().subscribe((data) => {
            this.actorsDB = data;
        });
    }
    //Create a new Actor, POST request
    onSaveActor() {
        let obj = { name: this.fullName, bYear: this.bYear };
        this.dbService.createActor(obj).subscribe(result => {
            this.onGetActors();
        });
    }
    // Update an Actor
    onSelectUpdate(item) {
        this.fullName = item.name;
        this.bYear = item.bYear;
        this.actorId = item._id;
    }
    onUpdateActor() {
        let obj = { name: this.fullName, bYear: this.bYear };
        this.dbService.updateActor(this.actorId, obj).subscribe(result => {
            this.onGetActors();
        });
    }
    //Delete Actor
    onDeleteActor(item) {
        this.dbService.deleteActor(item._id).subscribe(result => {
            this.onGetActors();
        });
    }
    //get movies
    onGetMovies() {
        this.dbService.getMovies().subscribe((data) => {
            this.moviesDB = data;
        });
    }
    onAddActor() {
        this.dbService.addActorToMovie(this.selectedActor._id, this.selectedMovie._id).subscribe((data) => {
            this.onGetMovies();
            this.onGetMovie(this.selectedMovie._id);
        });
    }
    onGetMovie(movieId) {
        this.dbService.getMovie(movieId).subscribe((data) => {
            // gets the actor as an object
            this.updatedMovie = data;
        });
    }
    // This lifecycle callback function will be invoked with the component get initialized by Angular.
    ngOnInit() {
        this.onGetActors();
        this.onGetMovies();
    }
    changeSection(sectionId) {
        this.section = sectionId;
        this.resetValues();
    }
    resetValues() {
        this.fullName = "";
        this.bYear = 0;
        this.actorId = "";
        this.selectedActor = null;
        this.selectedMovie = null;
    }
    //selecting movie and actor
    onSelectActor(item) {
        this.selectedActor = item;
    }
    onSelectMovie(item) {
        this.selectedMovie = item;
    }
}
